use itertools::iproduct;
use std::collections::HashSet;
use std::str;
use rayon::prelude::*;


fn expand_dictionary(h: Vec<(&str, &str)>) -> Vec<String> {
    h.iter()
        .flat_map(|(k, v)| {
            v.as_bytes()
                .chunks(3)
                .map(move |c| format!("{k}{cv}", cv = str::from_utf8(c).unwrap()))
        })
        .collect()
}

#[derive(Clone, Copy, Debug)]
enum KeyEntry {
    NotIn,
    IsIn,
    RightPlace,
}

fn match_word(word: &str, key: &[KeyEntry], guess: &str) -> bool {
    let mut wc = [0u8; 26];
    for ((w, k), g) in word.chars().zip(key).zip(guess.chars()) {
        if matches!(k, KeyEntry::RightPlace) {
            if w != g {
                return false;
            }
        } else {
            if w == g {
                return false;
            }
            wc[w as usize - 'A' as usize] += 1;
        }
    }
    for ((w, k), g) in word.chars().zip(key).zip(guess.chars()) {
        match *k {
            KeyEntry::IsIn => {
                if w == g {
                    return false;
                }
                if wc[g as usize - 'A' as usize] == 0 {
                    return false;
                }
                wc[g as usize - 'A' as usize] -= 1
            }
            KeyEntry::NotIn => {
                if wc[g as usize - 'A' as usize] > 0 {
                    return false;
                }
            }
            _ => {}
        }
    }
    true
}

fn pare_down<'a, 'b, 'c>(wordlist: &'c [&'a str], guess: &'b str) -> ([KeyEntry; 5], Vec<&'a str>) {
    let entry_kinds = [KeyEntry::RightPlace, KeyEntry::IsIn, KeyEntry::NotIn];

    let keys = iproduct!(
        entry_kinds,
        entry_kinds,
        entry_kinds,
        entry_kinds,
        entry_kinds
    )
    .map(|(a, b, c, d, e)| [a, b, c, d, e]);

    keys.map(|key| {
        (
            key,
            wordlist
                .iter()
                .filter(|word| match_word(word, &key, guess))
                .copied()
                .collect::<Vec<_>>(),
        )
    })
    .max_by_key(|x| x.1.len())
    .unwrap()
}

